#include "LIBUTI_SIF.h"
#include "LIBUTI_SIF_getters.h"
#include "LIBUTI_SIF_iterators.h"
#include "LIBUTI_SIF_hashes.h"
#include "LIBUTI_MEM.h"
#include "LIBUTI_SIF_getters_from_headers.h"

 boolean_t LIBUTI_SIF_has_target(const uint8_t *DecodedHeaderAddress, const uint8_t *TargetName, const uint32_t TargetNameLength, const uint8_t *HardwareID, const uint32_t HardwareIDLength) {     boolean_t is_target;     ts_LIBUTI_SIF_target v_target;     ts_LIBUTI_SIF_iterator v_titer;     TE_LIBUTI_SIF_status status;     status = LIBUTI_SIF_init_target_iterator(DecodedHeaderAddress, &v_titer); 	v_target.Name.Length = (uint16_t)0; 	v_target.hardware_identifier.Length = (uint16_t)0;     is_target = FALSE;     if (status == E_LIBUTI_SIF_SUCCESS)     {         status = LIBUTI_SIF_get_next_target(&v_target, &v_titer);     }     while(status != E_LIBUTI_SIF_FAILURE && (!is_target))     {         is_target = TRUE;         if (TargetName != NULL)         {             if (TargetNameLength == (uint32_t)(v_target.Name.Length))             {                 is_target = !LIBUTI_MEM_MemsNotEqual(TargetName, v_target.Name.Name, (uint32_t)(v_target.Name.Length));             }             else             {                 is_target = FALSE;             }         }         if (is_target && (HardwareID != NULL))         {             if (HardwareIDLength == (uint32_t)(v_target.hardware_identifier.Length))             {                 is_target = !LIBUTI_MEM_MemsNotEqual(HardwareID, v_target.hardware_identifier.Name, (uint32_t)(v_target.hardware_identifier.Length));             }             else             {                 is_target = FALSE;             }         }         status = LIBUTI_SIF_get_next_target(&v_target, &v_titer);     }     return is_target; }
